import Footer from "./components/Footer";
import Header from "./components/Header";
import Posts from "./components/Posts";
import Form from './components/Forms'
import { useState } from "react";
import { v4 as uuidv4 } from 'uuid';


export default function App() {
  const initializePost = [
    {
    id: uuidv4(),
    title:"Lorem ipsum is placeholder text",
    description:"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.",
    promote:true,
    picture:"data:image/jpeg;base64,",
    category:"edu",
    like: 0,
    dislike: 0,
    status:"d"
  },
  {
    id: uuidv4(),
    title:"Lorem ipsum is placeholder text",
    description:"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.",
    promote:true,
    picture:"data:image/jpeg;base64,",
    category:"oth",
    like: 0,
    dislike: 0,
    status:"d"
  },
  {
    id: uuidv4(),
    title:"Lorem ipsum is placeholder text",
    description:"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.",
    promote:true,
    picture:"data:image/jpeg;base64,",
    category:"edu",
    like: 0,
    dislike: 0,
    status:"p"
  },
]
  const [posts, setPost] = useState(initializePost);

  const handlePostLike = (id) => {
    const updatedPost = [...posts];

    posts.forEach((post) => {
      if (post.id === id) {
        post.like += 1;
      }
    })
    setPost(updatedPost);
  }

  const handlePostDisLike = (id) => {
    const updatedPost = [...posts];

    posts.forEach((post) => {
      if (post.id === id) {
        post.dislike += 1;
      }
    })
    setPost(updatedPost);
  }

  const handleAddPost = (title, description, promote, picture, category, status) => {
    const updatedPost = [...posts];

    updatedPost.push({
      id: uuidv4(),
      title,
      description,
      promote,
      picture,
      category,
      like: 0,
      dislike: 0,
      status
    });

    setPost(updatedPost);
  }

  return (
    <>
      <Header />
      <Posts posts={posts}
        onPostLike={handlePostLike}
        onPostDislike={handlePostDisLike}
      />
      <Form onHandleAddPost={handleAddPost} />
      <Footer />
    </>
  );
}
